import React,{ useState, useEffect } from "react";
import './MenuEmployee.css';
import { searchEmployee,createEmployee } from "./MenuEmployeeService"; 
class MenuEmployee extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
          employees: [],
          showForm: false,
          name: "",
          email: "",
          age: "",
          address: "",
          code:"",
          
        };
      };
      handleAddButtonClick = () => {
        this.setState({
          showForm: true,
        });
      };
      
      async componentDidMount() {
        
        const searchObject = {
          name:'',
          id:'',
          email:'',
          age:'',
          code:'',
          phone:''
        }; // assume we have an employee ID
        const employee = await searchEmployee(searchObject);
        this.setState({ employee });
        console.log("khanh");
        searchEmployee({})
          .then(res =>{
            console.log(res.data.data);
            this.setState({
              employees:res.data.data
            });
          })
      } 
      handleSubmit = (event) => {
        event.preventDefault();
        const employee = {
          name: this.state.name,
          email: this.state.email,
          age: this.state.age,
          address: this.state.address,
          code:this.state.code,
          phone:this.state.phone

        };
    
        // Gọi hàm xử lý việc post dữ liệu
        createEmployee(employee)
          .then(response => {
            console.log('Dữ liệu đã được post thành công!', response);
          // Thực hiện các hành động khác ở đây nếu cần
          })
          .catch(error => {
          console.error('Đã có lỗi xảy ra khi post dữ liệu:', error);
          // Xử lý lỗi ở đây nếu cần
        });
    
        this.setState({
          showForm: false,
        });
      };
      handleChange = (event) => {
        const { name, value } = event.target;
        this.setState({
          [name]: value,
        });
      };
    render(){
        const { employees } = this.state;
        return(
            <div>
                <div className="flex-container">
                <ul>
                    <li><a href="#news">Employee</a></li>
                    <li><a href="#about">About</a></li>
                </ul>
                </div>
                <div className="flex-container">
                <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Tên nhân viên</th>
            <th>Tuổi</th>
            <th>Mail</th>
            <th>Code</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {employees.map(employee => (
            <tr key={employee.id}>
              <td>{employee.id}</td>
              <td>{employee.name}</td>
              <td>{employee.age}</td>
              <td>{employee.email}</td>
              <td>{employee.code}</td>
              <td> 
              <button className="bt1">
              <img className="iconn" src="data:image/jpeg;base64," alt=""></img></button> <button><img className="iconn" src="data:image/png;base64," alt=""></img>
              </button> 
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      <button className="btx" onClick={this.handleAddButtonClick}>Thêm Nhân Viên</button>
            {this.state.showForm && (
              <form onSubmit={this.handleSubmit}>
        
        <div>
          <input
            type="email"
            id="email"
            name="email"
            placeholder="mail"
            value={this.state.email}
            onChange={this.handleChange}
          />
        </div>
        <div>
          <input
            type="text"
            id="name"
            name="name"
            placeholder="name"
            value={this.state.name}
            onChange={this.handleChange}
          />
        </div>
        <div>
          <input
            type="number"
            id="age"
            name="age"
            placeholder="age"
            value={this.state.age}
            onChange={this.handleChange}
          />
        </div>
        <div>
          <input
            type="text"
            id="address"
            name="address"
            placeholder="address"
            value={this.state.address}
            onChange={this.handleChange}
          />
        </div>
        <div>
          <input
            type="text"
            id="code"
            name="code"
            placeholder="Code"
            value={this.state.code}
            onChange={this.handleChange}
          />
        </div>
        <div>
          <input
            type="text"
            id="phone"
            name="phone"
            placeholder="Phone"
            value={this.state.phone}
            onChange={this.handleChange}
          />
        </div>
        <div>
          <input
            type="text"
            id="district"
            name="district"
            placeholder="District"
            value={this.state.dis}
            onChange={this.handleChange}
          />
        </div>
        <button className="btx" type="submit">Lưu thông tin</button>
      </form>
            )}
                </div> 
            </div>
        )
    }
}
export default MenuEmployee;
